 import React from 'react';
 import  { Toolbar, AppBar } from '@material-ui/core';
 import './App.css';


function Body() {
  return (
    <React.Fragment>
      <div className="Body">
      <h1 className="Header-one">A Tst body</h1>
      </div>
    </React.Fragment>
  )
}

function App() {
  return (
   <React.Fragment>
   <div className="App">
   <header className="App-header">
   <AppBar position="fixed">
     <Toolbar className="Tool-bar">{
       <h1 className="Header">Taiyaki</h1>

     }</Toolbar>
   </AppBar>
   </header>
   <Body/>
   </div>
   </React.Fragment>
  )
}

export default App;

